import styled from "styled-components";
import { motion } from "framer-motion";
import SearchComponent from "../components/search.componant";

const SearchLayoutStyle = styled(motion.div)``;
const SearchLayout = () => {
  return (
    <SearchLayoutStyle>
      <SearchComponent />
    </SearchLayoutStyle>
  );
};

export default SearchLayout;
